import React, { useState } from 'react'
import { Table } from 'antd'

const App = () => {

  const [data , setData]=useState({fname:'',mname:'',lname:''})
  const [userData , setUserData]=useState([])

const hendleOnChange = (e) => {
  console.log("eeeeeeeeeeeeeeeee",e.target.value)
  setData({...data, [e.target.name]:e.target.value})
}

const hendleOnSubmit = () => {
  const Data = userData
  console.log("Data---------->",Data)
  Data.push(data)
  setUserData([...Data])
}

const columns = [
  {
    title: 'FIRST NAME',
    dataIndex: 'fname',
    key: 'fname',
  },
  {
    title: 'MIDDLE NAME',
    dataIndex: 'mname',
    key: 'mname',
  },
  {
    title: 'LAST NAME',
    dataIndex: 'lname',
    key: 'lname',
  },
  {
    title: 'ACTION',
    dataIndex: 'action',
    key: 'action',

    render:(data,i,index) => (
      <>
      <Icon type="edit" onClick={() => {EditRow(data,i,index)}} />
      <Icon type="delete" onClick={() => {DeleteRow(data,i,index)}} />
      </>
    )
  },
];


  return (
    <>
    <div style={{ margin:10 , marginleft:20 }}>
      <label htmlFor="fname"><b>FIRST NAME : </b></label>
      <input type="text" name='fname' placeholder='Enter Your First Name' value={data.fname} onChange={(e) => hendleOnChange(e)} /><br />
      <label htmlFor="fname"><b>MIDDLE NAME : </b></label>
      <input type="text" name='mname' placeholder='Enter Your middle Name' value={data.mname} onChange={(e) => hendleOnChange(e)} /><br />
      <label htmlFor="fname"><b>LAST NAME : </b></label>
      <input type="text" name='lname' placeholder='Enter Your last Name' value={data.lname} onChange={(e) => hendleOnChange(e)} /><br />
      <button style={{margin:5,marginLeft:90 }} onClick={() => hendleOnSubmit()} >Button</button>
      <Table dataSource={userData} columns={columns} />
    </div>
    </>
  )
}
export default App;
